import React from "react";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import { Link } from "react-router-dom";
import { deleteTodo, doneTodo } from "../../redux/modules/todo";

function List() {
  const todos = useSelector((state) => state.todos);

  const dispatch = useDispatch();

  return (
    <div className="Todo">
      <div className="working">
        <h1>Working...üî•</h1>
        <div>
          {todos.map((todo) => {
            if (!todo.isDone) {
              return (
                <div key={todo.id}>
                  <Link to={`/${todo.id}`}>ÏÉÅÏÑ∏Î≥¥Í∏∞</Link>
                  <div>{todo.title}</div>
                  <div>{todo.body}</div>
                  <div>
                    <button
                      onClick={() => {
                        dispatch(deleteTodo(todo.id));
                      }}
                    >
                      ÏÇ≠Ï†úÌïòÍ∏∞
                    </button>
                    <button
                      onClick={() => {
                        dispatch(doneTodo(todo.id));
                      }}
                    >
                      ÏôÑÎ£å
                    </button>
                  </div>
                </div>
              );
            } else {
              return null;
            }
          })}
        </div>
      </div>
      <div className="done">
        <h1>Done! üéâ</h1>
        <div>
          {todos.map((todo) => {
            if (todo.isDone === true) {
              return (
                <div key={todo.id}>
                  <Link to={`/${todo.id}`}>ÏÉÅÏÑ∏Î≥¥Í∏∞</Link>
                  <div>{todo.title}</div>
                  <div>{todo.body}</div>
                  <div>
                    <button
                      onClick={() => {
                        dispatch(deleteTodo(todo.id));
                      }}
                    >
                      ÏÇ≠Ï†úÌïòÍ∏∞
                    </button>
                    <button
                      onClick={() => {
                        dispatch(doneTodo(todo.id));
                      }}
                    >
                      {todo.isDone ? "Ï∑®ÏÜå" : "ÏôÑÎ£å"}
                    </button>
                  </div>
                </div>
              );
            } else {
              return null;
            }
          })}
        </div>
      </div>
    </div>
  );
}
export default List;
